import axios from 'axios';

const API_BASE_URL = 'https://localhost:3500';

export const fetchHouses = async (filters) => {
  try {
    const response = await axios.get(`${API_BASE_URL}/houses`, {
      filters
    });
    return response.data;
  } catch (error) {
    console.error(error);
  }
};
